import React from 'react';
import PropTypes from 'prop-types';

import Grid from '@material-ui/core/Grid';
import JournalCard from './JournalCard.jsx';
import JournalEditor from './JournalEditor.jsx';
import MonthBreak from './MonthBreak.jsx';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';


const useStyles = makeStyles(theme => ({
    root: {
        margin: "0 5rem",
    }
}));

const QUESTIONS = [
    "What did you do today?",
    "What are you doing tomorrow?",
    "LOL idk this is a very long question to test if the styling works please ignore or if you feel like answering please tell me what your favorite fruit is. Rules: it cannot be pineapple, or apple, or anything that is not watermelon because watermelon is the only correct answer. Choose carefully."
]

export default function JournalGrid({ data }) {
    const classes = useStyles();


    // const renderEntries = () => (
    //     // Loop through the entries and render a grid 
    //     for(i = 0; i < data.length; ++i) {

    //     }
    //     return entryGridItems;      ;
    return (
        <div class={classes.root}>
            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <MonthBreak date={new Date()}></MonthBreak>
                </Grid>
                {/* <Grid item xs={12} md={4} lg={3}> */}
                <Grid item>
                    <JournalEditor questions={QUESTIONS} />
                    {/* <Button variant="outlined" size="large" className={classes.addBtn}>
                        Large
                    </Button> */}
                </Grid>
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="http://pixelartmaker.com/art/5da075d9350e793.png"
                        title="Shopping" />
                </Grid >
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080"
                        title="Brunch with friends" />
                </Grid >
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="https://img.freepik.com/free-vector/collection-with-flat-summer-fruit_23-2147551070.jpg?size=338&ext=jpg"
                        title="worked out" />
                </Grid >
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080"
                        title="went to Japan" />
                </Grid >
                <Grid item xs={12}>
                    <MonthBreak date={new Date(2000, 2, 9)}></MonthBreak>
                </Grid>
                <Grid item xs={12} md={4} lg={3}>
                    <JournalCard
                        pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080" />
                </Grid >
            </Grid>
        </div>
    );
}

JournalGrid.propTypes = {
    data: PropTypes.array
};
